import React from "react";
function card(){
   return(<div className="cards">
        <div className="card">
            <img className="img" alt="swaminarayan photo" src="https://pbs.twimg.com/media/Dt9bt3IX4AIEY4x.jpg"></img>
            <div className="cardinfo">
                <span className="cardcategory">swaminarayan photo kalupur</span>
                <h3 className="cardtitle">kalupur</h3>
                <a href="">
                    <button>watch now</button>
                </a>
            </div>
        </div>
    </div>);
}
// https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSp8pqJ8cY807dGS5J1lXOtG6R6W-lMWE5RaA&usqp=CAU

